def read_label_from(f):
    label_map = dict()
    brand_map = collections.defaultdict(list)
    ff = open(f ,"r")
    for line in ff.readlines():
        line = line.strip()
        if len(line) == 0 or line.startswith('#'):
            continue
        domain = line.split(',')[0]
        l = line.split(',')[-1]
        brand = line.split(',')[1]
        label_map[domain] = l
        brand_map[brand].append([domain,l])
    return label_map,brand_map


